import React from 'react';
import Person from './Person'


const Personlist = (props)=>{
     const list = props.people.map( i=>{
    return (<Person name={props.people[i].name} email={props.people[i].email} street1={props.people[i].address.street}
            street2={props.people[i].address.suite}
            street3={props.people[i].address.city}
     />
 );
})
    return (
        <div>
           {list} 
        </div>
    )
}

export default Personlist
